import { useNavigate } from "react-router-dom";

const MyPage = () => {
	const navigate = useNavigate();

	const handleHome = () => {
		navigate("/");
	};

	return (
		<div>
			<h1>Saved Recipes</h1>
			<p>Here are your saved recipes</p>
		</div>
	);
};

export default MyPage;
